import axios, { AxiosResponse } from "axios";
import APIS from "@/enums/apis";

interface KnowledgeLevelProps {
    setLevel: (level: string) => void
}

interface AvailableHoursTimeProps {
    setHours: (hourse: number) => void
}

interface PlatformPreferedProps {
    setPlatform: (platform: string) => void
}

interface BudgetProps {
    setBudget: (budget: number) => void
}

interface AreaInterestProps {
    setArea: (area: string) => void
}

interface FormProps {
    knowledgeLevel: string | null;
    availableHoursTime: number | null;
    platformPrefered: string | null;
    budget: number | null;
    interest: string | null;
}

interface ProfileFormDialogProps {
    open: boolean;
    setOpen: (value: boolean) => void;
    setExploding: (value: boolean) => void;
}

function ProfileFormDialog({ open, setOpen, setExploding }: ProfileFormDialogProps) {

    const [form, setForm] = React.useState<FormProps>({
        knowledgeLevel: null,
        availableHoursTime: null,
        platformPrefered: null,
        budget: null,
        interest: null
    });

    React.useEffect(() => {
        if (open && Object.values(form).every(value => value !== null)) {
            axios.post(APIS.CREATE_PROFILE, form)
                .then((response: AxiosResponse) => {
                    console.log(response);
                    setOpen(false);
                    setExploding(true);
                })
                .catch((error) => {
                    console.log(error);
                })
        }
    }, [form, open]);

    return (
        <div 
            className={`
                fixed top-0 left-0 w-screen h-screen bg-gray-900/30 backdrop-blur-sm grid place-items-center
                ${open ? 'opacity-100 pointer-events-auto z-[100] ' : 'opacity-0 z-[-100] pointer-events-none'}
            `}
        >
            <div className="bg-white w-[90%] max-w-[90%] h-[90%] max-h-[90%] rounded-lg p-6 lg:p-16 relative overflow-hidden">
                <div
                    className={`
                        bg-sky-600 absolute top-0 left-0 h-1.5
                        ${form.interest !== null 
                            ? 'w-full' 
                            : form.budget !== null
                                ? 'w-[80%]'
                                : form.platformPrefered !== null 
                                    ? 'w-[60%]'
                                    : form.availableHoursTime !== null 
                                        ? 'w-[40%]'
                                        : form.knowledgeLevel !== null 
                                            ? 'w-[20%]' 
                                            : ''}
                    `}
                />
                <button
                    onClick={() => setOpen(false)}
                    className="absolute top-0 right-0 px-4 py-1.5 mt-4 mr-4 rounded-sm border border-gray-200 hover:bg-gray-50 transition-all duration-300 ease-in-out"
                >
                    Omitir
                </button>
                <div className="grid grid-cols-1 grid-rows-1 max-h-full h-full">
                    {form.knowledgeLevel === null ? (
                        <KnowledgeLevel
                            setLevel={(level) => setForm({
                                ...form,
                                knowledgeLevel: level
                            })}
                        />
                    ) : form.availableHoursTime === null ? (
                        <AvailableHoursTime
                            setHours={(hours) => setForm({
                                ...form,
                                availableHoursTime: hours
                            })}
                        />
                    ) : form.platformPrefered === null ? (
                        <PlatformPrefered
                            setPlatform={(platform) => setForm({
                                ...form,
                                platformPrefered: platform
                            })}
                        />
                    ) : form.budget === null ? (
                        <Budget
                            setBudget={(budget) => setForm({
                                ...form,
                                budget: budget
                            })}
                        />
                    ) : form.interest === null && (
                        <AreaInterests
                            setArea={(area) => setForm({
                                ...form,
                                interest: area
                            })}
                        />
                    )}
                </div>
            </div>
        </div>
    );
}

